// frontend/src/pages/Dashboard.js
import React, { useState } from 'react';

const Dashboard = () => {
  const [apiKey, setApiKey] = useState('');
  const [scenario, setScenario] = useState('major');
  const [formData, setFormData] = useState({
    org_name: '',
    itsm_tools: '',
    observability_tools: '',
    service_names: '',
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    // Submit form data via an API call or further processing
    console.log('Scenario Submitted:', { scenario, ...formData, apiKey });
  };

  return (
    <div>
      <h1>PD Demo Generator Dashboard</h1>
      <div className="form-group">
        <label htmlFor="api_key_global">OpenAI API Key</label>
        <input
          type="password"
          className="form-control"
          id="api_key_global"
          placeholder="Enter your OpenAI API key"
          value={apiKey}
          onChange={(e) => setApiKey(e.target.value)}
          required
        />
      </div>
      <ul className="nav nav-tabs mt-4" role="tablist">
        {['major', 'partial', 'well'].map((tab) => (
          <li className="nav-item" key={tab}>
            <button
              className={`nav-link ${scenario === tab ? 'active' : ''}`}
              onClick={() => setScenario(tab)}
            >
              {tab.charAt(0).toUpperCase() + tab.slice(1)}
            </button>
          </li>
        ))}
      </ul>
      <div className="tab-content mt-3">
        <form onSubmit={handleSubmit}>
          <input type="hidden" name="scenario" value={scenario} />
          <div className="form-group">
            <label htmlFor={`org_name_${scenario}`}>Organization Name</label>
            <input
              type="text"
              className="form-control"
              id={`org_name_${scenario}`}
              name="org_name"
              value={formData.org_name}
              onChange={(e) =>
                setFormData({ ...formData, org_name: e.target.value })
              }
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor={`itsm_tools_${scenario}`}>ITSM Tools</label>
            <input
              type="text"
              className="form-control"
              id={`itsm_tools_${scenario}`}
              name="itsm_tools"
              value={formData.itsm_tools}
              onChange={(e) =>
                setFormData({ ...formData, itsm_tools: e.target.value })
              }
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor={`observability_tools_${scenario}`}>
              Observability Tools
            </label>
            <input
              type="text"
              className="form-control"
              id={`observability_tools_${scenario}`}
              name="observability_tools"
              value={formData.observability_tools}
              onChange={(e) =>
                setFormData({ ...formData, observability_tools: e.target.value })
              }
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor={`service_names_${scenario}`}>
              Service Name(s)
            </label>
            <input
              type="text"
              className="form-control"
              id={`service_names_${scenario}`}
              name="service_names"
              value={formData.service_names}
              onChange={(e) =>
                setFormData({ ...formData, service_names: e.target.value })
              }
              required
            />
          </div>
          <button type="submit" className="btn btn-primary">
            Generate {scenario.charAt(0).toUpperCase() + scenario.slice(1)} Scenario
          </button>
        </form>
      </div>
    </div>
  );
};

export default Dashboard;
